  //     })
  //     setfetching(false);
  //   }

  // useEffect(() => {

  //   load(baseurl+'all/?format=json');
  // },[])


  return (
    <BrowserRouter>
      <MessageProvider>
        <UserProvider>
          <div className="App">
            <NavBar />
            <div className='container'>
              <Routes>
                <Route index element={<Home url={baseurl} />} />
                <Route path='login' element={<Login url={baseurl}/> } />
                <Route path='logout' element={<Logout url={baseurl}/> } />
                <Route path=':homenum' element={<Home url={baseurl}/>} />
                <Route path=':homenum/:roomnum' element={<Home url={baseurl}/>} />
                <Route path=':hid/edit' element={<Edit url={baseurl}/>} />
                <Route path=':hid/:rid/edit' element={<Edit url={baseurl}/>} />
                <Route path=':hid/:rid/:lid/edit' element={<Edit url={baseurl}/>} />
              </Routes>
            </div>
          </div>
        </UserProvider>
      </MessageProvider>
    </BrowserRouter>
  );
}

export default App;
